import React from 'react'
import './Portfolio.css'
import { PortfolioCard } from './PortfolioCard'

export const Portfolio = () => {
    // Example data for the portfolio cards
    const portfolioData = [
        {
            image: require('../assets/work-1.jpg'),
            title: "Project One",
            category: "Web Development",
            date: "18 Sep. 2019"
        },
        {
            image: require('../assets/work-2.jpg'),
            title: "Project Two",
            category: "Web Development",
            date: "21 Oct. 2020"
        },
        {
            image: require('../assets/work-3.jpg'),
            title: "Web Development",
            category: "App Development",
            date: "05 Jan. 2021"
        },
        // {
        //     image: require('../assets/work-4.jpg'),
        //     title: "Project Four",
        //     category: "UI/UX",
        //     date: "12 Mar. 2022"
        // },
        // {
        //     image: require('../assets/work-5.jpg'),
        //     title: "Project Five",
        //     category: "Branding",
        //     date: "14 Nov. 2022"
        // },
        // {
        //     image: require('../assets/work-6.jpg'),
        //     title: "Project Six",
        //     category: "Illustration",
        //     date: "02 Jul. 2023"
        // }
    ];

    return (
        <div id='Projects' className='portfolio-container'>
            <div className='portfolio-topic'>
                <h2>PORTFOLIO</h2>
                <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit.</p>
                <div className='portfolio-line'></div>
            </div>
            <div className='portfolio-card-container2'>
                {portfolioData.map((project, index) => (
                    <PortfolioCard 
                        key={index} 
                        image={project.image} 
                        title={project.title} 
                        category={project.category} 
                        date={project.date} 
                    />
                ))}
            </div>
        </div>
    )
}
